import React from 'react';
const Item = ({ name}) => (
    <li>{name}</li>
    )

const About=props=>{
    const [ users, setUsers ] = useState([]);
    useEffect(() => {
        fetch('https://localhost:9000/search-route')
        .then(res => res.json())
        .then(json => {
        setUsers(json.data);
        });
        }, []);
    return(
        <div>
            <ul>
            {users.map(i => (
                <Item name={i.name}/>
            ))}
            </ul>
        </div>
    )
}
